border: 1px solid yellow;
width: 30vh;
height: 30vh;
font-size : 20px;
`;



const Boxb = () => {
    return <>{data.products.map((product)=>(
        <StyledBox>
            <img src={product.img} alt="no imag"></img>
            {product.title}
            {product.address}
            {product.price}
        </StyledBox>
        ))}
        </>

};

